            <br>
            </br>
            <br>
            </br>
            <br>
            </br>
            <h5 style={{textAlign: "left"}}>Fr책ga 2</h5>
            <textarea></textarea>      
            <br>
            </br>
            <br>
            </br>
            </div>
            <Button id="Previous-button" style={{ marginBottom: "20px", marginRight: "20px", marginLeft: "20px", width: "80px"}} variant="outline-secondary" onClick={Previous}>Tillbaka</Button>
            <Button id="Next-button" style={{ marginBottom: "20px", marginRight: "20px", marginLeft: "20px", width: "80px"}} variant="outline-secondary"onClick={Submit}>F채rdig</Button>
        </div>
    )
}

export default SurveyPart3;
